togomak uses native dependency resolution, based on references within their attributes. Let's take a look at this example: stage "alice" { script = "echo hello world"
} stage "bob" { script = "echo waiting for ${stage.alice.id}"
} In the above example, stage.alice naturally becomes a dependency of stage.bob. However, you can also explicitly specify dependencies if you would like to: stage "alice" { script = "hello world"
} stage "bob" { depends_on = [stage.alice] script = "hello bob"
}

