If you would like to run only specific stages, instead of the entire pipeline, you could do something like this: togomak stage1 stage2 This would run both stage1, stage2 and all the dependencies of stage1 and stage2. That means, if there were a stage stage3 which depends on stage1, then stage3 would also be included in the same pipeline. Now, you can also blacklist and whitelist certain stages. Let us take the specific example of togomak.hcl which is used to build togomak itself, at the root of this repository: togomak { version = 1
} stage "fmt" { script = "go fmt github.com/srevinsaju/togomak/v1/..."
}
stage "vet" { script = "go vet github.com/srevinsaju/togomak/v1/..."
}
stage "build" { depends_on = [stage.fmt, stage.vet] script = "go build -v -o ./cmd/togomak/togomak github.com/srevinsaju/togomak/v1/cmd/togomak"
}
stage "install" { depends_on = [stage.build] script = "go install github.com/srevinsaju/togomak/v1/cmd/togomak"
} stage "docs_serve" { daemon { enabled = true } if = false script = "cd docs && mdbook serve"
} In the above example, doing togomak build would run both stage.build and stage.install. However, if you would like to run only stage.build and not stage.install, you could do: togomak build ^install The ^ operator is used as a blacklist operator. Similarly, if you would like to add the stage.fmt along with the stages which run, you would do: togomak build ^install +fmt Here, the + operator, is used as a whitelist operator. You can add multiple +{stage_name} and ^{stage_name} and togomak would run all the stages which meet the criteria.

